import React, { useEffect } from "react";
import { Switch, Route, Link, Redirect } from "react-router-dom";
import GroupList from "./components/group/GroupList";
import Home from "./components/Home";
import withLoading from "./hoc/withLoading";
import { connect } from "react-redux";
import {
  selectListGroups,
  selectLoading,
} from "./redux/selectors/groupSelector";

function App(props) {
  const getListGroup = props.getListGroupAsysncAction;

  useEffect(() => {
    getListGroup();
  }, [getListGroup]);

  const GroupListWithLoading = withLoading(GroupList);
  return (
    <div>
      <nav>
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/groups">Groups List</Link>
          </li>
        </ul>
      </nav>

      <Switch>
        <Route path="/" componet={Home} exact />
        <Route
          path="/groups"
          componet={() => (
            <GroupListWithLoading
              groups={props.groups}
              isLoading={props.isLoading}
            />
          )}
          exact
        />
        <Redirect to="/" />
      </Switch>
    </div>
  );
}

const mapGlobalStateToProps = (state) => {
  return {
    groups: selectListGroups(state),
    isLoading: selectLoading(state),
  };
};

export default connect(mapGlobalStateToProps, { getListGroupAsysncAction })(
  App
);
